import "../CSS/OurMission.css"

function OurMission() {
    return (
    <div className="OurMissionWhole">
        <img src={blueImageDiv}/>
        <div className="OurMissionDescription">
            <h1>Our Mission</h1>
        </div>
    </div>
    )};

  export default OurMission;
